import React, { useState } from 'react';
import './App.css';
import FaqSection from './components/FAQ/FAQSection';
import BottomNavbar from './components/BNB/bottomNavBar';
import LoginModal from './components/Login/LoginModal';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Pagination } from 'swiper/modules';
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';

// ðŸ”¹ COMPONENTE: PodrÃ¡s
const Podras = () => (
  <section className="podras-section py-10 bg-gray-100 text-center">
    <h2 className="text-2xl font-bold mb-6">PodrÃ¡s...</h2>
    <div className="grid grid-cols-2 md:grid-cols-5 gap-4 px-4">
      {[
        { text: 'Comprar', img: '/assets/icons/comprar.webp' },
        { text: 'Vender', img: '/assets/icons/vender.svg' },
        { text: 'Donar', img: '/assets/icons/donar.svg' },
        { text: 'Explorar', img: '/assets/icons/explorar.svg' },
        { text: 'Compartir Ideas', img: '/assets/icons/compartir.svg' },
      ].map((item, i) => (
        <div key={i} className="bg-white shadow rounded-xl p-4 hover:shadow-lg transition flex flex-col items-center">
          <img src={item.img} alt={item.text} className="w-12 h-12 mb-2" />
          <div className="text-xl font-semibold">{item.text}</div>
        </div>
      ))}
    </div>
  </section>
);

// ðŸ”¹ COMPONENTE: ReseÃ±as
const ReseÃ±as = () => (
  <section className="reseÃ±as-section py-10 bg-gray-100 text-center">
    <h2 className="text-2xl font-bold mb-6">ReseÃ±as</h2>
    <Swiper
      modules={[Navigation, Pagination]}
      spaceBetween={20}
      slidesPerView={1}
      navigation
      pagination={{ clickable: true }}
      breakpoints={{
        768: { slidesPerView: 2 },
        1024: { slidesPerView: 3 },
      }}
    >
      {[1, 2, 3].map((item, i) => (
        <SwiperSlide key={i}>
          <div className="review-card bg-white rounded-xl p-4 shadow mx-4">
            <div className="review-stars text-yellow-500 text-xl mb-2">{i === 1 ? 'â˜…â˜…â˜…â˜…â˜†' : 'â˜…â˜…â˜…â˜…â˜…'}</div>
            <p className="review-text italic">
              {i === 0 && 'Excelente plataforma, probÃ© antes de suscribirme.'}
              {i === 1 && 'Muy Ãºtil, aunque podrÃ­a tener mÃ¡s apps.'}
              {i === 2 && 'Ideal para estudiantes, fÃ¡cil de usar.'}
            </p>
            <p className="mt-2 font-semibold">â€” Usuario {i + 1}</p>
          </div>
        </SwiperSlide>
      ))}
    </Swiper>
  </section>
);

function App() {
  const [isLoginModalOpen, setIsLoginModalOpen] = useState(false);

  return (
    <div className="App">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="navbar-brand">
          <span className="brand-prime">Prime</span> 
          <span className="brand-testing"> Testing</span>
        </div>
        <div className="navbar-buttons">
          <button className="btn-login" onClick={() => setIsLoginModalOpen(true)}>
            Iniciar SesiÃ³n
          </button>
          <button className="btn-join">Unirse</button>
        </div>
      </nav>

      {/* Login Modal */}
      <LoginModal 
        isOpen={isLoginModalOpen} 
        onClose={() => setIsLoginModalOpen(false)}
      />

      {/* Main content of the page */}
      <main className="main-content">
        <div className="premium-services">
          <div className="text-content">
            <h1>
              PRUEBA LOS <span className="premium">SERVICIOS PREMIUM</span> DE TUS APLICACIONES FAVORITAS
            </h1>
            <p className="descripcion-home">
              ESCOGE LA APLICACIÃ“N QUE DESEES, PRUEBA Y DECIDE SI SUSCRIBIRTE
            </p>
            <button className="btn-join-2">UNIRSE</button>
          </div>
          <div className="image-content">
            <img src="/assets/images/GalleryViewWebPages.svg" alt="App Screenshots" className="app-image" />
          </div>
        </div>

        <div className="opciones-aliados">
          <h2>Aliados</h2>
          <div className="aliados-container">
            <img src="/assets/images/Spotify.svg" alt="Spotify" />
            <img src="/assets/images/Patreon.svg" alt="Patreon" />
            <img src="/assets/images/AppleMusic.svg" alt="AppleMusic" />
            <img src="/assets/images/Discord.svg" alt="Discord" />
            <img src="/assets/images/Youtube.svg" alt="Youtube" />
          </div>
        </div>

        {/* NUEVAS SECCIONES */}
        <Podras />
        <ReseÃ±as />

        {/* FAQ */}
        <FaqSection />
      </main>

      {/* Bottom Navigation Bar */}
      <BottomNavbar />
    </div>
  );
}

export default App;
